import "./App.css";
import { Card, CardContent } from "@material-ui/core";
import App1 from "./components/Country";
import Cards from "./components/Cards";
function App() {
  return (
    <>
      <div className="country-style">
        <App1 />
      </div>
      <div className="card-style">
        <Cards
          title="Coronavirus Cases"
          cases={countryInfo.active}
          total={4000}
        />
        <Cards title="recovered" cases={countryInfo.recovered} total={4000} />
        <Cards title="death Cases" cases={124} total={4000} />
      </div>

      <Card>
        <CardContent></CardContent>
      </Card>
    </>
  );
}

export default App;
